// src/pages/PetDetails.jsx
import React, { useEffect, useState } from 'react';
import { useParams, Link, useNavigate } from 'react-router-dom';
import api from '../services/api';

export default function PetDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [pet, setPet] = useState(null);
  const [eventos, setEventos] = useState([]);

  useEffect(() => {
    const fetchPet = async () => {
      try {
        const response = await api.get(`/pets/${id}`);
        setPet(response.data);
      } catch (error) {
        console.error('Erro ao buscar detalhes do pet:', error);
      }
    };

    const fetchEventos = async () => {
      try {
        const response = await api.get(`/eventos/pet/${id}`);
        setEventos(response.data);
      } catch (error) {
        console.error('Erro ao buscar eventos do pet:', error);
      }
    };

    fetchPet();
    fetchEventos();
  }, [id]);

  const handleDelete = async () => {
    if (window.confirm('Tem certeza que deseja excluir este pet?')) {
      try {
        await api.delete(`/pets/${id}`);
        navigate('/pets');
      } catch (error) {
        console.error('Erro ao excluir pet:', error);
      }
    }
  };

  const handleCheckout = async (eventoId) => {
    try {
      await api.put(`/eventos/${eventoId}/checkout`);
      const response = await api.get(`/eventos/pet/${id}`);
      setEventos(response.data);
    } catch (error) {
      console.error('Erro ao fazer checkout do evento:', error);
    }
  };

  if (!pet) return <div>Carregando detalhes...</div>;

  return (
    <div className="container my-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <button onClick={() => navigate('/pets')} className="btn btn-secondary">← Voltar à Lista</button>
      </div>

      <h2 className="mb-3">{pet.nome}</h2>

      <div className="d-flex justify-content-start mb-4">
        <Link to={`/pets/${id}/editar`} className="btn btn-warning me-2">Editar</Link>
        <button onClick={handleDelete} className="btn btn-danger">Excluir</button>
      </div>

      <ul className="list-group mb-4">
        <li className="list-group-item"><strong>Espécie:</strong> {pet.especie}</li>
        <li className="list-group-item"><strong>Raça:</strong> {pet.raca}</li>
        <li className="list-group-item"><strong>Idade:</strong> {pet.idade} anos</li>
        <li className="list-group-item"><strong>Peso:</strong> {pet.peso} kg</li>
        <li className="list-group-item"><strong>Porte:</strong> {pet.porte}</li>
        <li className="list-group-item"><strong>Sexo:</strong> {pet.sexo}</li>
        <li className="list-group-item"><strong>Cor:</strong> {pet.cor}</li>
        <li className="list-group-item"><strong>Castrado:</strong> {pet.castrado ? 'Sim' : 'Não'}</li>
        <li className="list-group-item"><strong>Carteira de Vacinação em Dia:</strong> {pet.carteiraVacinacao ? 'Sim' : 'Não'}</li>
        <li className="list-group-item"><strong>Observações:</strong> {pet.observacoes || 'Nenhuma'}</li>
      </ul>

      <h4>Eventos</h4>
      {eventos.length > 0 ? (
        <ul className="list-group mb-3">
          {eventos.map((evento) => (
            <li key={evento._id} className="list-group-item d-flex justify-content-between align-items-center">
              <div>
                <strong>{evento.tipo}</strong> em {new Date(evento.dataEntrada).toLocaleString()}
                {evento.dataSaida && ` - Saída: ${new Date(evento.dataSaida).toLocaleString()}`}
              </div>
              {!evento.dataSaida && (
                <button
                  onClick={() => handleCheckout(evento._id)}
                  className="btn btn-sm btn-outline-primary"
                >
                  Check-out
                </button>
              )}
            </li>
          ))}
        </ul>
      ) : (
        <p className="mb-3">Este pet ainda não possui eventos.</p>
      )}

      <div className="d-flex justify-content-end">
        <Link to={`/pets/${id}/novo-evento`} className="btn btn-success">
          Cadastrar Evento
        </Link>
      </div>
    </div>
  );
}
